import React from 'react';
import {connect} from 'react-redux'
import './view-lines.styles.scss'


const ViewLines = ({userTeam, opponentTeam}) => (
    <div className = 'view-lines'>
      <h1>View Lines</h1>  
      <ul >
      {Object.keys(userTeam).map((position, i) => (<ul><li><li>{userTeam[position].name}</li><li>{userTeam[position].projectedPoints}</li></li></ul>))}
      </ul>
    </div>
)

const mapStateToProps = state => ({
  userTeam: state.lineup.userTeam,
  opponentTeam: state.lineup.opponentTeam
})
export default connect(mapStateToProps,null)(ViewLines)
